import React from "react";
import "./SignInForm.css";
import "react-bootstrap";
// import { } from "react-bootstrap";
import chatIcon from "../img/chat-app-icon.png";

const SignInForm = () => {
  return (
    <div className="center br4 ba b--black-10 mv7 mw7-ns h-50 shadow-5">
      <div className="pa4 black-80">

          <fieldset id="sign_up" className="ba b--transparent ph0 mh0">
            <div className="text-center mt3">
              <img src={chatIcon} className="chatIcon" alt="chat-icon"></img>
              <h3 className="f1 fw6 ph0 mh0">Sign in to Chat</h3>
              <input
                type="email"
                placeholder="Username"
                className="pa3 ba bg-transparent w-100"
              />
              <input
                type="email"
                placeholder="Password"
                className="pa3 ba bg-transparent w-100"
              />
            </div>
          </fieldset>

      </div>
    </div>
  );
};

export default SignInForm;
